import React from 'react';

import './App.css';
import UserInput from "./views/UserInput";
import UserOutput from "./view/UserOutput";


function App() {
  return (
    <div className="App">
      <UserInput/>
      <UserOutput/>
    </div>
  );
}

export default App;
